  public void testAttachment(Context context) throws Exception {
    byte[] cipherKey = new byte[32];
    byte[] macKey = new byte[32];

    SecureRandom.getInstance("SHA1PRNG").nextBytes(cipherKey);
    SecureRandom.getInstance("SHA1PRNG").nextBytes(macKey);

    Cipher cipher = Cipher.getInstance("AES/CBC/PKCS5Padding");
    cipher.init(Cipher.ENCRYPT_MODE, new SecretKeySpec(cipherKey, "AES"));

    Mac mac = Mac.getInstance("HmacSHA256");
    mac.init(new SecretKeySpec(macKey, "HmacSHA256"));

    byte[] ciphertext = cipher.doFinal(IMAGE);
    ciphertext[ciphertext.length-1] = (byte)(ciphertext[ciphertext.length-1] + 1);

    mac.update(cipher.getIV());
    byte[] mactext    = mac.doFinal(ciphertext);

    byte[] attachment = Util.combine(cipher.getIV(), ciphertext, mactext);

    File             attachmentFile = File.createTempFile("test", "test");
    FileOutputStream fout           = new FileOutputStream(attachmentFile);

    fout.write(attachment, 0, attachment.length);

    BitmapUtil.createScaledBitmap(context,
                                  new AttachmentStreamUriLoader.AttachmentModel(attachmentFile, Util.combine(cipherKey, macKey)), 500, 500);
  }




